    state = {};

    render() {
        return (
            <div className='chat'>
                <MessageList messages={["aaa", "bbb", "ccc"]}/>
                <MessageBox onSendMessage={message => {
                    alert("Message sent: " + message)
                }}/>
            </div>
        );
    }
}

export default Chat
